import React, {Component} from "react";
import {Form ,Modal ,Col ,Row ,Button} from 'react-bootstrap';

class DelModal extends Component{
    constructor(props) {
        super(props)
        this.state={
            walletname:'',
            u_id:props.u_id,
            username:props.username,
            loggedin:props.loggedin,
            data:props.data
        }

        this.onChange = this.onChange.bind(this);
       // this.handleSubmit = this.handleSubmit.bind(this);


    }


    onChange(e)
    {
        this.setState({
            [e.target.name] : e.target.value
        })
    }


    render() {
        const data=this.state.data;
        let i=0;
        return (
            <Modal
                {...this.props}
                aria-labelledby="contained-modal-title-vcenter"
                centered>
                <Modal.Header>
                    <Modal.Title id="contained-modal-title-vcenter">
                        Delete Wallets
                    </Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <form onSubmit={this.handleSubmit}>
                        <div className="form-group">
                            <label>Choose Wallets to Delete</label>

                            <Form.Group id="formGridCheckbox">
                                {data.map((d)=> (
                                    <Form.Check type="checkbox" label={d.wallet_name} key={i++} value={d.wallet_name}
                                                onClick={this.onValueChange}/>
                                ))
                                }
                            </Form.Group>


                        </div>
                        <button type="submit" className="btn btn-primary btn-block">Delete Wallet</button>
                    </form>
                </Modal.Body>
                <Modal.Footer>
                    <Button onClick={this.props.onHide}>Back</Button>
                </Modal.Footer>
            </Modal>
        );
    }
}


export default DelModal;
